function computeNextGeneration(grid) {
  const newGrid = grid.map(arr => [...arr]);
  
  for (let i = 0; i < grid.length; i++) {
    for (let j = 0; j < grid[i].length; j++) {
      const neighbors = countNeighbors(grid, i, j);
      
      // Rgle 1: Une cellule morte avec exactement 3 voisins devient vivante
      if (!grid[i][j] && neighbors === 3) {
        newGrid[i][j] = true;
      }
      // Rgle 2: Une cellule vivante avec 2 ou 3 voisins survit
      else if (grid[i][j] && (neighbors < 2 || neighbors > 3)) {
        newGrid[i][j] = false;
      }
    }
  }
  
  return newGrid;
}
